The last months there are many rumors about TPB. The old TPB tracker might be dead, but TPB isn't.

@namez 
As far as I know there's no Propellerheads Record Key, but there's a Propellerheads Record Key.

At the forum more people see requests, so it's in your own benefit to post requests there.

@brianxxx 

You just asked a normal question, so no need to apologize. I know you've been here for a long time and always try to provide some usefull info for those who need it. TPB and uploaders appreciate that very much. :)

BTW: The forum is a usefull place for all kind of help and info.
